package StackAndQueuePackage;public interface QueueInterface<T>{   /* Adds an element newElement to the front of the queue. */   public void enqueue(T newElement);   	/* Removes and returns the element at the front of the queue. Returns null if the queue is empty */   public T dequeue();	/* Retrieves the element at the front of the queue. Returns null if the queue is empty */   public T getFront();	/* Checks whether the queue is empty. Returns true if the queue is empty */   public boolean isEmpty();   /* Clears the queue by removing all elements from the queue */   public void clear();} // end QueueInterface